// src/pages/Dashboard/Dashboard.jsx
import React, { useState, useEffect } from 'react';
import { Radar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  RadialLinearScale,
  PointElement,
  LineElement,
  Filler,
  Tooltip,
  Legend,
} from 'chart.js';
import './Dashboard.css';

// Register ChartJS components
ChartJS.register(RadialLinearScale, PointElement, LineElement, Filler, Tooltip, Legend);

const Dashboard = () => {
  const [answers, setAnswers] = useState({
    cleanliness: 5,
    sleep: 5,
    noise: 5,
    guests: 5,
    sharing: 5,
    conflict: 5,
    petsAttitude: 5,
    petsResponsibility: 5,
  });

  const [visibleQuestions, setVisibleQuestions] = useState(0);

  useEffect(() => {
    const timer = setTimeout(() => {
      setVisibleQuestions((prev) => Math.min(prev + 1, questions.length));
    }, 420);

    return () => clearTimeout(timer);
  }, [visibleQuestions]);

  const questions = [
    {
      id: 'cleanliness',
      question: "How do you usually handle shared spaces? üßπ‚ú®",
      options: [
        { text: "I clean everything immediately ‚Äî sparkling clean life!", score: 9 },
        { text: "I tidy up daily, but I'm not obsessed", score: 7 },
        { text: "I clean when it starts looking messy", score: 4 },
        { text: "Cleaning? I'll do it... eventually... maybe", score: 2 },
      ],
    },
    {
      id: 'sleep',
      question: "What's your sleep rhythm like? üåôüí§",
      options: [
        { text: "Early to bed, early to rise ~ very consistent", score: 9 },
        { text: "Midnight is my golden hour", score: 6 },
        { text: "I'm a proud night owl (2‚Äì5 AM gang)", score: 3 },
        { text: "Sleep schedule? I just crash when I can't anymore", score: 1 },
      ],
    },
    {
      id: 'noise',
      question: "How do you feel about background sounds? üé∂üîá",
      options: [
        { text: "I love music, calls, games ‚Äî the livelier the better!", score: 9 },
        { text: "Some noise is fine, but not too loud or constant", score: 6 },
        { text: "I prefer quiet most of the day", score: 3 },
        { text: "I need almost complete silence to focus / relax", score: 1 },
      ],
    },
    {
      id: 'guests',
      question: "How often do you have friends over? üë•üéâ",
      options: [
        { text: "Almost every week ‚Äî my place is the hangout spot!", score: 9 },
        { text: "A few times a month is perfect", score: 6 },
        { text: "Rarely ‚Äî maybe once every 1‚Äì2 months", score: 3 },
        { text: "Almost never ‚Äî I like my space private", score: 1 },
      ],
    },
    {
      id: 'sharing',
      question: "Sharing food & stuff ‚Äî your vibe? üçïü•ë",
      options: [
        { text: "What's mine is yours! Community fridge energy", score: 9 },
        { text: "We can share sometimes, but let's talk first", score: 6 },
        { text: "I prefer keeping my things separate", score: 3 },
        { text: "My food is my food. No sharing, please.", score: 1 },
      ],
    },
    {
      id: 'conflict',
      question: "When there's a disagreement, how do you handle it? üó£Ô∏èüí¨",
      options: [
        { text: "I talk about it right away ‚Äî clear the air fast!", score: 9 },
        { text: "I wait a bit, then bring it up calmly", score: 6 },
        { text: "I avoid conflict if possible... maybe drop hints", score: 3 },
        { text: "I just keep it inside until I explode or leave", score: 1 },
      ],
    },
    {
      id: 'petsAttitude',
      question: "How do you feel about living with pets? üê∂üê±",
      options: [
        { text: "I LOVE pets! The more the merrier ‚ô°", score: 9 },
        { text: "I'm okay with pets if they're well-behaved", score: 6 },
        { text: "I'm neutral ‚Äî I don't mind but also don't need them", score: 4 },
        { text: "I'd rather live without pets (allergies / preference)", score: 2 },
      ],
    },
    {
      id: 'petsResponsibility',
      question: "If there‚Äôs a pet in the house, how do you feel about helping out? üêæüßº",
      options: [
        { text: "I'm happy to walk/feed/clean after them ‚Äî team player!", score: 9 },
        { text: "I can help sometimes, but prefer the owner does most", score: 6 },
        { text: "I'll do the bare minimum if I have to", score: 3 },
        { text: "Pet care is 100% the owner's responsibility ‚Äî not mine", score: 1 },
      ],
    },
  ];

  const handleAnswer = (questionId, score) => {
    setAnswers((prev) => ({
      ...prev,
      [questionId]: score,
    }));
  };

  // Mock best match (you can replace with real data later)
  const bestMatch = {
    cleanliness: 8,
    sleep: 7,
    noise: 6,
    guests: 5,
    sharing: 7,
    conflict: 8,
    petsAttitude: 7,
    petsResponsibility: 7,
  };

  const radarData = {
    labels: [
      'Cleanliness',
      'Sleep Rhythm',
      'Noise Tolerance',
      'Guests',
      'Sharing',
      'Conflict Style',
      'Pet Friendliness',
      'Pet Care Willingness',
    ],
    datasets: [
      {
        label: 'Your Roomie Vibe',
        data: Object.values(answers),
        backgroundColor: 'rgba(255, 123, 140, 0.24)',
        borderColor: '#ff7b8c',
        borderWidth: 3,
        pointBackgroundColor: '#fff',
        pointBorderColor: '#ff7b8c',
        pointHoverBackgroundColor: '#ff7b8c',
        pointHoverBorderColor: '#fff',
      },
      {
        label: 'Dream Roomie Match',
        data: Object.values(bestMatch),
        backgroundColor: 'rgba(167, 230, 215, 0.26)',
        borderColor: '#a7e6d7',
        borderWidth: 3,
        pointBackgroundColor: '#fff',
        pointBorderColor: '#a7e6d7',
        pointHoverBackgroundColor: '#a7e6d7',
        pointHoverBorderColor: '#fff',
      },
    ],
  };

  const radarOptions = {
    responsive: true,
    maintainAspectRatio: false,
    animation: {
      duration: 1600,
      easing: 'easeOutCubic',
    },
    plugins: {
      legend: {
        position: 'top',
        labels: {
          font: { size: 15, weight: 700, family: "'Poppins', sans-serif" },
          color: '#5c4b51',
          padding: 22,
          usePointStyle: true,
          boxWidth: 14,
        },
      },
      tooltip: {
        backgroundColor: 'rgba(255, 245, 240, 0.97)',
        titleColor: '#ff7b8c',
        bodyColor: '#5c4b51',
        borderColor: '#ffb3c1',
        borderWidth: 2,
        cornerRadius: 14,
        padding: 14,
      },
    },
    scales: {
      r: {
        angleLines: { color: 'rgba(255,123,140,0.28)' },
        grid: { color: 'rgba(255,123,140,0.20)' },
        pointLabels: {
          font: { size: 13.5, weight: 600, family: "'Poppins', sans-serif" },
          color: '#ff7b8c',
        },
        ticks: {
          stepSize: 2,
          color: '#8a7580',
          backdropColor: 'transparent',
        },
        min: 0,
        max: 10,
      },
    },
  };

  return (
    <div className="dashboard-page">
      <div className="container">
        <h1 className="page-title">RoomieRadar Dashboard ‚ô°</h1>
        <p className="subtitle">
          Discover your roommate personality + pet compatibility~ üß∏üêæüíó
        </p>

        {/* Radar Chart */}
        <div className="card radar-card fade-in">
          <h2 className="card-title">Your Roomie Compatibility Radar</h2>
          <div className="radar-wrapper">
            <Radar data={radarData} options={radarOptions} />
          </div>
        </div>

        {/* Personality + Pet Questions */}
        <div className="card questions-card fade-in" style={{ animationDelay: '0.5s' }}>
          <h2 className="card-title">Let's get to know your roomie soul~ ‚úø</h2>
          <p className="card-subtitle">
            Pick what feels most like you ‚Äî the radar updates instantly!
          </p>

          <div className="questions-grid">
            {questions.map((q, index) => (
              <div
                key={q.id}
                className={`question-block ${index < visibleQuestions ? 'visible' : 'hidden'}`}
                style={{ transitionDelay: `${index * 160}ms` }}
              >
                <h3 className="question-text">{q.question}</h3>

                <div className="options-container">
                  {q.options.map((option, idx) => {
                    const isSelected = answers[q.id] === option.score;
                    return (
                      <button
                        key={idx}
                        className={`option-btn ${isSelected ? 'selected' : ''}`}
                        onClick={() => handleAnswer(q.id, option.score)}
                      >
                        {option.text}
                      </button>
                    );
                  })}
                </div>

                <div className="current-score">
                  Your vibe: <span>{answers[q.id]}</span>/10
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Decorations */}
      <div className="decor bear-1">üß∏</div>
      <div className="decor bear-2">üêª</div>
      <div className="decor cat">üê±</div>
      <div className="decor dog">üê∂</div>
      <div className="decor heart-1">üíó</div>
      <div className="decor heart-2">‚ô°</div>
      <div className="decor cloud">‚òÅÔ∏é</div>
    </div>
  );
};

export default Dashboard;
